This sample shows how to call PutAsync with required parameters.

var client = new DictionaryClient().GetStringValueClient("1.0.0");

var body = new Dictionary<string, string>
{
    ["key"] = "<null>",
};
var result = await client.PutAsync(body);

This sample shows how to call Put with required parameters.

var client = new DictionaryClient().GetStringValueClient("1.0.0");

var body = new Dictionary<string, string>
{
    ["key"] = "<null>",
};
var result = client.Put(body);

This sample shows how to call PutAsync with required request content.

StringValue client = new DictionaryClient().GetStringValueClient("1.0.0");

var data = new
{
    key = "<String>"
};

Response response = await client.PutAsync(RequestContent.Create(data));
Console.WriteLine(response.Status);

